  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:26.940412\",\n\t\"name\": \"morton-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Morton
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan and research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, forests, grasslands, fire management,
  and wilderness areas. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, animal control, and marking and bird banding. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, fishing, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, equipment replacement, and energy conservation. Items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
